import React from 'react'
import Nav from './Nav'
import Headcontent from './Headcontent'

function Header() {
    return (
        <div className="bg-gradient-to-r from-blue-400 to-blue-600 h-[51.25rem] ">
            <Nav />
            <Headcontent/>
            </div>
    )
}

export default Header
